function parseVmessLink(vmessLink) {
  // ÂéªÊéâÂºÄÂ§¥ÁöÑ"vmess://"
  const base64String = vmessLink.substring(8);
  const jsonString = atob(base64String);
  return JSON.parse(jsonString);
}


async function fetchCountryInfoByIP(ip) {
    // ÂÖà‰ªéÁºìÂ≠ò‰∏≠Êü•Êâæ
    if (globalCache[ip]) {
        return globalCache[ip];
    }

    // Â¶ÇÊûúÁºìÂ≠ò‰∏≠Ê≤°ÊúâÔºåÊâçÂèëËµ∑Êñ∞ÁöÑËØ∑Ê±Ç
    const response = await fetch(`https://ipinfo.io/${ip}?token=f0cab96266b46c`);
    const data = await response.json();
    const countryInfo = {
        emoji: countryToEmoji(data.country),
        shortName: data.country
    };

    // Â∞ÜÁªìÊûúÂ≠òÂÖ•ÁºìÂ≠ò
    globalCache[ip] = countryInfo;

    return countryInfo;
}

