function generateVmessLink(vmessData) {
  // Â∞ÜvmessDataÂØπË±°ËΩ¨Êç¢‰∏∫JSONÂ≠óÁ¨¶‰∏≤
  const jsonString = JSON.stringify(vmessData);

  // ‰ΩøÁî®encodeURIComponentËΩ¨Êç¢UnicodeÂ≠óÁ¨¶ÔºåÁÑ∂ÂêéÁî®unescapeËΩ¨Êç¢‰∏∫Latin1ËåÉÂõ¥ÁöÑÂ≠óÁ¨¶
  const uriEncodedString = encodeURIComponent(jsonString);
  const latin1String = unescape(uriEncodedString);

  // Áé∞Âú®‰ΩøÁî®btoaÂØπÁªèËøáÂ§ÑÁêÜÁöÑÂ≠óÁ¨¶‰∏≤ËøõË°åBase64ÁºñÁ†Å
  const base64String = btoa(latin1String);

  // Â∞ÜBase64ÁºñÁ†ÅÁöÑÂ≠óÁ¨¶‰∏≤Ê∑ªÂä†Âà∞vmess://ÂâçÁºÄÂêéÔºåÂΩ¢ÊàêÂÆåÊï¥ÁöÑVmessÈìæÊé•
  return `vmess://${base64String}`;
}



